*{
    box-sizing: border-box;
    margin: 0;
    padding: 0;
    user-select: none;
}
.mainHead{
    position: relative;
    left:50%; 
    margin-left:-100px;
    border: 1px solid black;
    width: 200px;
    height: 200px;
    border-radius: 100%;
    background-color:#0097e3 ;
}
.face{
    border: 1px solid black;
    position: absolute;
    width: 170px;
    height: 150px;
    left: 14px;
    top: 40px;
    border-radius: 80%;
    background-color:white ;
}
.nose{
    border: 1px solid black;
border-radius: 100% ;
background-color: #cc0000;
position: absolute;
left: 50%;
margin-left:-10px;
top: 70px;
width: 20px;
height: 20px;
}

.eye-right{
    border: 1px solid black;
    position: absolute;
    width: 50px;
    height: 50px;
    border-radius: 40%;
    left: 50%;
    top: -43px;
    background-color: white;
}
.eye-left{
    border: 1px solid black;
    position: absolute;
    width: 50px;
    height: 50px;
    border-radius: 40%;
    top: -43px;
    left:-40px;
    background-color: white;
}
.eye-ball-left{
    border: 1px solid black;
    position: absolute;
    width: 7px;
    height: 7px;
    left:32px;
    top: 30px;
    border-radius: 100%;
    background-color: black;
}
.eye-ball-right{
    border: 1px solid black;
    position: absolute;
    width: 7px;
    height: 7px;
    right:32px;
    top: 30px;
    border-radius: 100%;
    background-color: black;
}
.middleLine{
    position: absolute;
    height: 70px;
    width: 1px;
    left: 8px;
    top: 19px;
    background-color: #969696;
    z-index: 2;
}

.mouth{
    border: 1px solid black;
    position:absolute;
    border-radius: 60%;
    width: 150px;
    height: 100px;
    left: -66px;
    top: -10px;
    border-top-color: transparent;
    border-left-color: transparent;
    border-right-color: transparent;
}
.beard-middle{
    position: absolute;
    width: 160px;
    height: 1px;
    top: 40px;
    left: -71px;
    background-color: black;
}
.beard-up{
    position: absolute;
    width: 160px;
    height: 1px;
    top: 40px;
    left: -71px;
    transform: rotate(15deg);
    background-color: black;
}
.beard-down{
    position: absolute;
    width: 160px;
    height: 1px;
    top: 40px;
    left: -71px;
    transform: rotate(-15deg);
    background-color: black;

}
.shadow{
    position: absolute;
    width: 80px;
    height: 30px;
    left: -31px;
    top: 25px;
    background-color: white;
}
